import React from 'react';
import TrafficSignal from './TrafficSignal';
import './App.css';
import { Provider } from 'react-redux'
import store from './redux/index';

export default function App() {
  return (
  <Provider store={store}>
    <TrafficSignal />
  </Provider>
  );
}
